Keel on sümbolite süsteem, mis võimaldab inimestel suhelda, mille abil saab edasi anda mõtteid, tundeid ja teavet. See on keeruline ning ühtlasi üks kõige olulisemaid inimühiskonna seisandit mõjutavaid tegureid. Keele kaudu suhtlevad inimesed üksteisega, luuakse sotsiaalne kord ning võetakse vastu otsuseid.

# Keele uurimine

Keele uurimine on keeleteaduse keskne osa, mis hõlmab keele struktuuri, funktsioone, ajalugu ning selle kasutamise analüüsi. Keeleuurijad püüavad mõista, kuidas keel funktsioneerib, kuidas see kujuneb ning kuidas see mõjutab inimeste suhtlemist ja maailmapilti.

## Keeleteaduse harud

Keeleteaduse harud on:

* Fonoloogia, mis uurib keele häälikusüsteemi;
* Morfoloogia, mis uurib keele sõnade struktuuri;
* Süntaks, mis uurib keele lauseehitust;
* Semantika, mis uurib keele tähendust;
* Pragmatika, mis uurib keele kasutamist ning selle funktsioone.

## Keele uurimise meetodid

Keele uurimise meetodid on:

* Empiiriline uurimine, mis hõlmab andmete kogumist ning analüüsi;
* Eksperimentaalne uurimine, mis hõlmab katseid ning seaduste väljatöötamist;
* Teoreetiline uurimine, mis hõlmab keele modelleerimist ning seaduste väljatöötamist.

# Keele teke

Keele teke on üks keeleteaduse kõige komplekssemaid probleeme. Keele tekkimise kohta on mitmeid teooriaid, kuid ükski neist ei ole veel täielikult tõestatud.

## Keele tekkimise teooriad

Keele tekkimise teooriad on:

* Imitatsiooniteooria, mis väidab, et keel tekkis inimeste korduvate kõnemustrite imiteerimise tulemusena;
* Muusikateooria, mis väidab, et keel tekkis muusika ning laulude kaudu;
* Mimesis teooria, mis väidab, et keel tekkis inimeste tegevuste jäljendamise ning sümbolite kasutamise tulemusena.

## Keele tekkimise faktorid

Keele tekkimise faktorid on:

* Inimeste vajadus suhtluseks ning kommunikatsiooniks;
* Inimeste kognitiivsed võimed ning tundlikkus;
* Inimeste sotsiaalne ühiskond ning kultuur.

# Keele muutumine

Keele muutumine on keele süstemaatiline muutumine ajas. Keele muutumine on tingitud mitmest tegurist, nagu inimeste suhtlemise vajadused, sotsiaalne ühiskond ning kultuur.

## Keele muutumise põhjused

Keele muutumise põhjused on:

* Inimeste suhtlemise vajadused;
* Sotsiaalne ühiskond ning kultuur;
* Teknoloogiline areng;
* Poliitiline ning majanduslik stabiilsus.

## Keele muutumise tüübid

Keele muutumise tüübid on:

* Fonoloogiline muutumine, mis hõlmab häälikute muutumist;
* Morfoloogiline muutumine, mis hõlmab sõnade struktuuri muutumist;
* Süntaktiline muutumine, mis hõlmab lauseehituse muutumist;
* Semantiline muutumine, mis hõlmab tähenduse muutumist.

# Keelte mitmekesisus

Keelte mitmekesisus on keelte erinevus ning mitmekesisus üle maailma. Keelte mitmekesisus on tingitud mitmest tegurist, nagu inimeste suhtlemise vajadused, sotsiaalne ühiskond ning kultuur.

## Keelte mitmekesisuse põhjused

Keelte mitmekesisuse põhjused on:

* Inimeste suhtlemise vajadused;
* Sotsiaalne ühiskond ning kultuur;
* Geograafiline eraldatus;
* Ajaloolised sündmused.

## Keelte mitmekesisuse tüübid

Keelte mitmekesisuse tüübid on:

* Keele perekonnad, mis hõlmavad keeli, mis on suguluses üksteisega;
* Keele rühmad, mis hõlmavad keeli, mis on üksteisega suguluses;
* Keele isolaadid, mis hõlmavad keeli, mis ei ole suguluses ühegi teise keelega.

